import { Carousel } from 'react-bootstrap';
import React from 'react';



export default class ItemCarrossel extends React.Component {
    render() {
        let width = 400;
        let height = 400;
        var stationComponents = this.props.myJson.map(function (myJson) {
            return(

            <Carousel.Item>
                <img width={width} height={height} alt="900x500" src={require(myJson.imagesrc)} />
                <Carousel.Caption>
                    <h3>{myJson.label}</h3>
                    <p>{myJson.caption}</p>
                </Carousel.Caption>
            </Carousel.Item>

            )
        });


        return stationComponents;
    }
}
